import { useState} from 'react';

const Display = (props) => {
    return (
        <div>{props.counter}</div>
    )
}
const App = () => {
    const [counter, setCounter] = useState(0);
    const beTouched = () => {
        setCounter(counter + 1)
    }
    return (
        <div>
            {counter}
            <button onClick={beTouched}>点击</button>
        </div>
    )
}
export default App;
